export default function ItemsSubCategory({ subCategory, productTitle }) {
  return (
    <ItemsSubCategoryStyles>
      <h3>{subCategory.category_title}</h3>
      <SubCategoryListItem subCategory={subCategory} productTitle={productTitle} />
    </ItemsSubCategoryStyles>
  );
}
